import React from 'react'
import HeroSection from './AboutUs/HeroSection'
import Detail from './AboutUs/Detail'
import Competitors from './AboutUs/Competitors'

const index = () => {
    return (
        <div>
            <HeroSection />
            <Detail/>
            <Competitors/>
        </div>
    )
}

export default index;
